wwv_flow_imp_page.create_page_plug(
 p_id=>wwv_flow_imp.id(35402143000250832410)
,p_plug_name=>'Style Wise Stock'
,p_region_template_options=>'#DEFAULT#:t-Region--removeHeader js-removeLandmark:t-Region--scrollBody'
,p_plug_template=>wwv_flow_imp.id(32541360918945887183)
,p_plug_display_sequence=>10
,p_include_in_reg_disp_sel_yn=>'Y'
,p_function_body_language=>'PLSQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    vDATASET    CLOB;',
'BEGIN',
'vDATASET := vDATASET||'' <input id="b_print" type="button" class="t-Button01_526" style="float:right;"  onclick="printdiv(''''div_print'''');" value=" Print " onload="openWindow.print()">'';',
'',
'vDATASET := vDATASET||''<div id="div_print">'';',
'',
'vDATASET := vDATASET||''',
'',
'    <div class="top-header">',
'        <div class="top-header-section">',
'            <div>',
'                <img src="./logo.png" alt="">',
'            </div>',
'',
'            <div class="top-header-logo-section">',
'                <div class="head-title">',
'                    <h2>Northern Tosrifa Ltd</h2>',
'                    <p>Munnu Nogor,Tongi,Gazipur</p>',
'                    <p>Email: abdullahalmamun063@gmail.com</p>',
'                    <p>Mobile:+8801729605209</p>',
'                </div>',
'            </div>',
'',
'            <div class="head-right-item"></div>',
'        </div>',
'    </div>'';',
'',
'  vDATASET := vDATASET||''',
'   <div class="main-body">',
'        <!-- Middle-Header-Start -->',
'        <div class="mid-header">',
'            <div style="display: flex; justify-content: space-between; align-items: flex-end; margin-top: 20px;">',
'                ',
'            </div>',
'        </div>',
'        <!-- Middle-Header-End --> ',
'        <table>',
'            <thead>',
'                <tr id="border-remove">',
'                    <th colspan="7" class="bottom-header"></th>',
'                </tr>',
'              ',
'                <tr style="font-weight: bold;">',
'                    <td>SI#</td>',
'                    <td>Style ID</td>',
'                    <td>Style Name</td>',
'                    <td>Finishing Date</td>',
'                    <td>Total Receive </td>',
'                    <td>Total Reject </td>',
'                    <td>Total Balance</td>',
'                </tr>',
'                <!-- Table-Header-End -->',
'            </thead>',
'',
'            <tbody>'';',
'',
'            FOR STK IN (SELECT ROWNUM SL, SS.STYLE_ID, STYS.STYLE_NAME, FIN.ENTRY_DATE,FIN.TOTAL_SEND TOTAL_RECEIVE ,FIN.TOTAL_REJECT, FIN.TOTAL_BALANCE',
'                          FROM STYLE_STK SS',
'                          LEFT JOIN STYLE_SETUP STYS ON STYS.ID = SS.STYLE_ID',
'                          LEFT JOIN FINISHING FIN ON TO_NUMBER(FIN.BUYER_NAME) =  STYS.BUYER_ID',
'                          LEFT JOIN EMPLOYEE EMP ON EMP.EMP_ID = TO_NUMBER(FIN.RESPONSIBLE_PERSON)',
'                        WHERE EMP.EMP_ID = :P4_PERSON_ID',
'                          AND FIN.ENTRY_DATE BETWEEN :P4_DATE_FROM AND :P4_DATE_TO) ',
'            LOOP',
'',
'                ',
'            vDATASET := vDATASET||'' ',
'                <tr>',
'                    <td>''||STK.SL||''</td>',
'                    <td style="text-transform: uppercase;">''||STK.STYLE_ID||''</td>',
'                    <td>''||STK.STYLE_NAME||''</td>',
'                    <td>''||STK.ENTRY_DATE||''</td>',
'                    <td>''||STK.TOTAL_RECEIVE||''</td>',
'                    <td>''||STK.TOTAL_REJECT||''</td>',
'                    <td>''||STK.TOTAL_BALANCE||''</td>',
'                </tr>'';',
'                vDATASET := vDATASET||''</div>'';',
'                END LOOP;',
'',
'                /*vDATASET := vDATASET||''<th id="border-remove-LR" style="height: 15px; "> total</th>',
'',
'                                                ',
'                   ',
'                                        </tr>'';*/',
'              ',
'        vDATASET := vDATASET||''  </tbody>'';',
'           ',
'        vDATASET := vDATASET||'' </table>'';',
'',
'        vDATASET := vDATASET||''</div>'';',
'         ',
'',
'       RETURN vDATASET;',
'',
'END;'))
,p_lazy_loading=>false
,p_plug_source_type=>'NATIVE_DYNAMIC_CONTENT'
,p_plug_comment=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE ',
'vSLNO NUMBER :=1;',
'BEGIN',
'        Htp.p('' <input id="b_print" type="button" class="t-Button01_526" style="float:right;"  onclick="printdiv(''''div_print'''');" value=" Print " onload="openWindow.print()">'');',
'        Htp.p('' <input id="b_print" type="button" style="float:right;"  onClick="tableToExcel(''''div_print'''');" value=" Excel ">''); ',
'',
'        htp.p(''<div id="div_print">'');',
'        htp.p(''<div id="div_print1"  class="page" size="A4">'');',
'        --------------',
'        htp.p(''<div class="stk-rpt">'');',
'        ',
'                htp.p(''<div class="stk-head">',
'                    <h1>Cash & Carry</h1>',
'                    <h4>Dhanmondi, Kolabagan, Green Road, Keyari Plaza, Dhaka - 1205</h4>',
'                    <h3>Present Stock Report</h3>'');',
'                     ',
'               htp.p('' </div>'');',
'                 ',
'                 htp.p(''<div class="stk-body">'');',
'                     --htp.p(''<table id="myTable" style="width:100%"; border="1px solid black">'');',
'                     htp.p(''<table id="example" class="table table-striped table-bordered" style="width:100%"; border="1px solid black">'');',
'                        htp.p('' <tr>',
'                             <th>Sl No</th>',
'                             <th>Product Code</th>',
'                             <th>Product Name</th>',
'                             <th>Product Model</th>',
'                             <th>Unit Price</th>',
'                             <th>Stock Quantity</th>',
'                             <th>Value</th>',
'                         </tr>'');',
'                FOR C1 IN (SELECT PRODUCT_ID,PRODUCT_NAME,PRODUCT_MODEL,SELLING_PRICE, TO_CHAR(PURCHASE_PRICE,''99G99G99G999D99'') PURCHASE_PRICE,',
'                                  NVL(STOCK_QUANTITY,0) STOCK_QUANTITY , TO_CHAR(NVL(VALUE_PRICE,0),''99,99,999.99'') VALUE_PRICE',
'                            FROM',
'                                (SELECT ',
'                                     "PRODUCT_ID" PRODUCT_ID,',
'                                     "PRODUCT_NAME" PRODUCT_NAME,',
'                                     PRODUCT_MODEL  PRODUCT_MODEL,',
'                                     "SELLING_PRICE" SELLING_PRICE,',
'                                     "PURCHASE_PRICE"  PURCHASE_PRICE,',
'                                     (SELECT NVL(PRODUCT_QUANTITY,0) FROM STOCK S WHERE S.PRODUCT_ID= P.PRODUCT_ID) "STOCK_QUANTITY",',
'                                     (PURCHASE_PRICE * (SELECT NVL(PRODUCT_QUANTITY,0) FROM STOCK S WHERE S.PRODUCT_ID= P.PRODUCT_ID)) VALUE_PRICE',
'                                FROM PRODUCT P) DT',
'                                ORDER BY VALUE_PRICE DESC)  LOOP',
'                                ',
'                         htp.p(''<tr>',
'                             <td>''||vSLNO||''</td>',
'                             <td>''||C1.PRODUCT_ID||''</td>',
'                             <td>''||C1.PRODUCT_NAME||''</td>',
'                             <td>''||C1.PRODUCT_MODEL||''</td>',
'                             <td>''||C1.PURCHASE_PRICE||''</td>',
'                             <td>''||C1.STOCK_QUANTITY||''</td>',
'                             <td>''||C1.VALUE_PRICE||''</td>',
'                         </tr>'');',
'                          vSLNO :=vSLNO+1;',
'                         END LOOP;',
'                     htp.p(''</table>'');',
'                 htp.p('' </div>'');',
'                 ',
'         htp.p(''<footer>'');',
'       htp.p(''This is the text that goes at the bottom of every page.'');',
'            htp.p(''</footer>'');',
'   htp.p(''</div>'');',
'',
'END;',
'',
''))
);
