'                    <td>''||C1.TOTAL_RECEIVE_FROM_SEWING||''</td>',
'                    <td>''||C1.TOTAL_BALANCE||''</td>',
'                </tr>'';',
'',
'               vDATA_OUTPUT := vDATA_OUTPUT||''</div>'';',
'',
'               vDATA_OUTPUT := vDATA_OUTPUT||''</div>'';',
'          ',
