wwv_flow_imp_page.create_page_validation(
 p_id=>wwv_flow_imp.id(32563243339303014638)
,p_validation_name=>'valid password'
,p_validation_sequence=>10
,p_validation=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'    vcounter   NUMBER := 0;',
'    vStatus    number := 0;',
'BEGIN',
'    SELECT COUNT (USER_NO)',
'      INTO vcounter',
'      FROM HT_USER_INFO',
'     WHERE     UPPER (USER_NAME) = UPPER ( :P9999_USERNAME)',
'           AND USER_KEY = :P9999_PASSWORD;',
'',
'    SELECT SUM(NVL(IS_FAULT,0))',
'    INTO vStatus',
'    FROM HT_USER_INFO',
'    WHERE UPPER (USER_NAME) = UPPER ( :P9999_USERNAME);',
'    ',
'    IF vStatus >= 10 THEN',
'       UPDATE HT_USER_INFO',
'           SET IS_LOCK = ''Y''',
'         WHERE UPPER (USER_NAME) = UPPER ( :P9999_USERNAME);',
'    END IF;',
'',
'    IF vcounter = 0 THEN',
'        UPDATE HT_USER_INFO',
'           SET IS_FAULT = NVL (IS_FAULT, 0) + 1',
'         WHERE UPPER (USER_NAME) = UPPER ( :P9999_USERNAME);',
'',
'        COMMIT;',
'        RETURN FALSE;',
'    ELSIF vcounter > 1 THEN',
'        UPDATE HT_USER_INFO',
'           SET IS_FAULT = NVL (IS_FAULT, 0) + 1',
'         WHERE UPPER (USER_NAME) = UPPER ( :P9999_USERNAME);',
'',
'        COMMIT;',
'        RETURN FALSE;',
'    END IF;',
'END;'))
,p_validation2=>'PLSQL'
,p_validation_type=>'FUNC_BODY_RETURNING_BOOLEAN'
,p_error_message=>'invalid password!'
,p_when_button_pressed=>wwv_flow_imp.id(32541664625062887246)
,p_associated_item=>wwv_flow_imp.id(32541663848173887245)
